// 메뉴 전체 레이아웃
import React from 'react'
import PropTypes from 'prop-types'
import { Layout, Menu, Breadcrumb, Space, PageHeader, Button} from 'antd';
import { UserOutlined, PieChartOutlined, DesktopOutlined} from '@ant-design/icons';
const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

import Link from 'next/link';

const MenuHeader = () => {
    return (
      <PageHeader
      ghost={false}
      // onBack={() => window.history.back()}
      title="FAKE-SHOP"
      subTitle="by devCoderian"
      // style ={{background:'#0077b6'}}
      extra={[
        <Button key="2" icon={<UserOutlined />}>Cart</Button>,
        <Button key="1" icon={<UserOutlined />}>
          <Link href ="/profile"> profile</Link>
        </Button>,
      ]}
    ></PageHeader>
    )
}

export default MenuHeader;
